import React from 'react'

const CollectionDetails = ({items}) => {
    return (
        <div>
            {
                items.map(item => (
                <>
                    <h1>{item.name}</h1>
                    <img src={item.imageUrl} alt=""/>
                    <iframe src={item.videoUrl}
                        frameBorder='0'
                        allow='autoplay; encrypted-media'
                        allowFullScreen
                        title='video'
                    />
                </>
                ))
            }
        </div>
    )
}

export default CollectionDetails
